import React from 'react';
import Item from './item.js';

class Body extends React.Component{
    constructor(props){
        super(props);
        this.state={
            number:"01/05",
            kind:"Innovation\nRetail\nSpace\nBrand",
            detail_detail:"The re"
        }
    }
    render(){
        const left = <div className={'main_left'}><div className={'main_left_number'}></div><div className={'main_left_kind'}></div></div>;
        const picture = <div className={'main_picture'}></div>;
        const detail = <div className={'main_detail'}><div className={'main_detail_detail'}></div><div className={'main_detail_changebar'}></div>
        <div className={'main_detail_title'}></div></div>;
        const right = <div className={'main_right'}><div className={'main_right_nextPicture'}></div><div className={'main_right_fullStory'}>Read the full<br/>story</div></div>;

        const main = <div className={'main'}>{left}{picture}{detail}{right}</div>
        const items = <div className={'items'}><Item/></div>
        const div=<div>{main}{items}</div>

        return(div);
    }
}

export default Body;
